import { useNavigate } from 'react-router-dom';
import { useEffect, useState } from 'react';
import './GamesOwned.css';

const GamesOwned = () => {
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  
  // Sample game data with more details
  const allGames = [
    {
      id: 1,
      name: "Mobile Legends",
      developer: "Moonton",
      hoursPlayed: 156,
      lastPlayed: "2 days ago",
      image: "data:image/jpeg;base64,",
      achievements: 24,
      genre: "MOBA",
      rating: 4.5,
      status: "Installed"
    },
    {
      id: 2,
      name: "Special Force",
      developer: "Dragonfly",
      hoursPlayed: 89,
      lastPlayed: "1 week ago",
      image: "data:image/jpeg;base64,",
      achievements: 15,
      genre: "FPS",
      rating: 4.2,
      status: "Not Installed"
    },
    {
      id: 3,
      name: "Valorant",
      developer: "Riot Games",
      hoursPlayed: 42,
      lastPlayed: "3 days ago",
      image: "data:image/jpeg;base64,",
      achievements: 8,
      genre: "Tactical FPS",
      rating: 4.7,
      status: "Installed"
    },
    {
      id: 4,
      name: "Genshin Impact",
      developer: "miHoYo",
      hoursPlayed: 67,
      lastPlayed: "5 days ago",
      image: "data:image/jpeg;base64,",
      achievements: 19,
      genre: "Action RPG",
      rating: 4.8,
      status: "Installed"
    }
  ];

  const [games, setGames] = useState(allGames);

  // Simulate loading data
  useEffect(() => {
    const timer = setTimeout(() => {
      setIsLoading(false);
    }, 800);
    return () => clearTimeout(timer);
  }, []);

  // Filter games based on search term
  useEffect(() => {
    const filtered = allGames.filter(game =>
      game.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      game.genre.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setGames(filtered);
  }, [searchTerm]);

  const handleLaunchGame = (gameName) => {
    alert(`Launching ${gameName}...`);
    // In a real app, you would launch the game here
  };

  if (isLoading) {
    return (
      <div className="games-owned-container loading">
        <div className="loading-spinner"></div>
      </div>
    );
  }

  return (
    <div className="games-owned-container">
      <header className="games-header">
        <button onClick={() => navigate('/dashboard')} className="back-btn">
          &larr; Back to Dashboard
        </button>
        <h1>My Game Collection</h1>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search games..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <span className="search-icon"></span>
        </div>
      </header>

      <div className="games-grid">
        {games.length > 0 ? (
          games.map(game => (
            <div key={game.id} className="game-card">
              <div 
                className="game-banner"
                style={{ backgroundImage: `url(${game.image})` }}
              >
                <div className="game-overlay"></div>
                <h2>{game.name}</h2>
                <span className="game-rating">{game.rating} </span>
                <span className={`game-status ${game.status.toLowerCase().replace(' ', '-')}`}>
                  {game.status}
                </span>
              </div>
              
              <div className="game-details">
                <div className="game-info">
                  <span><strong>Developer:</strong> {game.developer}</span>
                  <span><strong>Genre:</strong> {game.genre}</span>
                  <span><strong>Playtime:</strong> {game.hoursPlayed}h</span>
                </div>
                
                <div className="game-meta">
                  <span className="achievement-badge">
                     {game.achievements} achievements
                  </span>
                  <span className="last-played">
                    Last played: {game.lastPlayed}
                  </span>
                </div>
                
                <button 
                  className={`play-btn ${game.status === 'Not Installed' ? 'install-btn' : ''}`}
                  onClick={() => handleLaunchGame(game.name)}
                >
                  {game.status === 'Installed' ? 'Launch Game' : 'Install Now'}
                </button>
              </div>
            </div>
          ))
        ) : (
          <div className="no-games">
            <p>No games found matching your search.</p>
            <button onClick={() => setSearchTerm('')}>Clear search</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default GamesOwned;